ORYX.I18N.Feedback.info=<p>Oryx \u662f\u4e00\u4e2a\u7814\u7a76\u5e73\u53f0\uff0c\u5b83\u7684\u76ee\u7684\u662f\u652f\u6301\u5546\u4e1a\u8fc7\u7a0b\u7ba1\u7406\u9886\u57df\u7684\u79d1\u5b66\u5bb6\uff0c\u5e76\u7528\u7075\u6d3b\u7684\u3001\u6269\u5c55\u7684\u5de5\u5177\u6765\u68c0\u9a8c\u7814\u7a76\u6210\u679c\u548c\u6267\u884c\u7ecf\u9a8c\u3002</p><p>\u6211\u4eec\u5f88\u9ad8\u5174\u4e3a\u4f60\u63d0\u4f9b\u6211\u4eec\u5e73\u53f0\u7684<a href\=\\\"http\://bpt.hpi.uni-potsdam.de/Oryx/ReleaseNotes\\\" target\=\\\"_blank\\\">\u6700\u65b0\u7684\u6280\u672f\u548c\u6539\u8fdb</a>\u3002<a href\=\\\"http\://bpt.hpi.uni-potsdam.de/Oryx/DeveloperNetwork\\\" target\=\\\"_blank\\\">\u6211\u4eec</a>\u5728\u52aa\u529b\u4e3a\u4f60\u63d0\u4f9b\u4e00\u4e2a\u53ef\u9760\u7684\u7cfb\u7edf\uff0c\u5373\u4f7f\u4f60\u6709\u65f6\u5019\u4f1a\u9047\u5230\u5c0f\u5c0f\u7684\u95ee\u9898\u3002</p><p>\u5982\u679c\u4f60\u6709\u5982\u4f55\u6539\u8fdb Oryx \u7684\u60f3\u6cd5\u3001\u548c\u5e73\u53f0\u4e60\u60ef\u7684\u7591\u95ee\u3001\u6216\u60f3\u62a5\u544a\u51fa\u73b0\u7684\u95ee\u9898\uff1a<strong>\u8bf7\u8ba9\u6211\u4eec\u77e5\u9053\u3002</strong></p>
